    "2016-07-27T22:42:16.180316",nt"name": "polycyclic-aromatic-hydrocarbon-investigation-for-the-san-juan-river-san-juan-county-new-m",nt"isopen":
    false,nt"url": null,nt"notes": "In October of 1992, Environmental Contaminants
    Program personnel from the U.S. Fish and Wildlife Service's New Mexico Ecological
    Services State Office assayed bile collected from San Juan River flannelmouth suckers
    for polycyclic aromatic hydrocarbon (PAH) metabolites. The objective of this study
    was to determine if San Juan fish, including endangered fish (i.e., Colorado squawfish),
    are being exposed to PAH contamination. Thirty-two bile samples from twenty-four
    flannelmouth suckers were collected along five separate reaches of the San Juan
    River between river mile markers 80 and 156. This report presents data showing the
    presence of three PAH compounds, naphthalene, phenanthrene and benzo[a]pyrene (BaP),
    and the findings of a literature search concerning the possible deleterious effects
    of these compounds on fish in the San Juan River. All of the fish samples analyzed
    contained levels of naphthalene and phenanthrene and eleven of the twenty-four samples
    contained levels of BaP. Variations in fish species, life histories, habitat preferences,
    feeding habits, and physiology limit the conclusions that can be drawn from noting
    the observed levels of PAHs. Also, the PAH aquatic biotoxicity database is probably
    too limited at this point, especially for flannelmouth suckers, to use the data
    presented in this report to forecast ecological risks to San Juan River fish communities.
    However, due to the high carcinogenicity of this group of compounds, the fact that
    there is evidence of widespread contamination in one fish species warrants concern
    for the health of the entire San Juan River aquatic ecosystem.",nt"license_title":
